contracts/shared/DataTypes.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

library DataTypes {
    struct Patient {
        uint256 id;
        string name;
        uint256 age;
        string gender;
        string avatar;
        address account;
        bool isDeleted;
    }

    struct Doctor {
        uint256 id;
        string name;
        string specialization;
        string licenseId;
        address account;
        string biography;
        string avatar;
        bool isDeleted;
    }

    struct MedicalRecord {
        uint256 id;
        uint256 patientId;
        uint256 doctorId;
        string ipfsUrl;
        string patientName;
        string diagnosis;
        string prescription;
        uint256 timestamp;
        bool isDeleted;
    }

    struct Appointment {
        uint256 id;
        uint256 patientId;
        uint256 doctorId;
        uint256 timestamp;
        bool isConfirmed;
        bool isDeleted;
        bool isRejected;
        uint256 fee;
    }

    struct Payment {
        uint256 id;
        address from;
        address to;
        uint256 amount;
        uint256 royalty;
        uint256 timestamp;
        string purpose;
    }
}

contracts/shared/Errors.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

library Errors {
    // Access and Authorization
    error UnauthorizedAccess();
    error NotPatientOwner();
    error NotDoctorOwner();
    error InvalidSender();

    // Registration
    error AlreadyRegistered();
    error PatientNotFound();
    error DoctorNotFound();

    // Validation
    error InvalidPatientId();
    error InvalidDoctorId();
    error InvalidRecordId();
    error InvalidAppointmentId();
    error InvalidTimestamp();
    error DeletedPatient();
    error DeletedDoctor();
    error DeletedRecord();

    // Payment and Booking
    error InsufficientFee();
    error DoctorShareTooLow();
    error RoyaltyTooLow();
    error PaymentToDoctorFailed();
    error PaymentToOwnerFailed();

    // Misc
    error AddressZero();
    error SameDayBookingNotAllowed();
}

contracts/shared/Events.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

library Events {
    event PatientRegistered(uint256 indexed id, address indexed account);
    event DoctorRegistered(uint256 indexed id, address indexed account);
   
    event AppointmentBooked(uint256 indexed id, uint256 indexed patientId, uint256 indexed doctorId);
    event AppointmentRejected(uint256 indexed id, uint256 indexed patientId, uint256 indexed doctorId);
    event AccessGranted(uint256 indexed patientId, address indexed grantee);
    event AccessRevoked(uint256 indexed patientId, address indexed grantee);
    event PaymentMade(uint256 indexed id, address indexed from, address indexed to, uint256 amount, uint256 royalty, string purpose);
    event PatientDeleted(uint256 indexed patientId);
    event DoctorDeleted(uint256 indexed doctorId);
    event RecordDeleted(uint256 indexed recordId);
    event AppointmentDeleted(uint256 indexed appointmentId);
   
}

